import { useState } from 'react';

import './ExpenseCancel.css';

const ExpenseCancel = (props) => {
    const [changedCancel, setChangedCancel] = useState(props.cancel);

    const onClickCancel = () => {
        setChangedCancel(!props.cancel);

        console.log('ExpenseCancel',props.cancel);

        const changedCancleData = {
            cancel : changedCancel
        }

        props.onChangedCancelData(changedCancleData);
    }

    return (
        <div>
            <button onClick={onClickCancel}>Cancel</button>
        </div>
    );
}

export default ExpenseCancel;
